import React, {FC} from 'react';
import {Card, CardActions, Container, CardContent, Typography, Button, Avatar} from '@mui/material';
import { deepOrange, deepPurple } from '@mui/material/colors';

import {TeamMember} from "../BoxPreview";

interface BoxTeamProps {
    leader?: string;
    members?: TeamMember[],
    title: string;
    total?: number;
}
export const BoxTeamPreview: FC<BoxTeamProps> = ({ leader, members, title, total }) => {
    return (
        <Container>
            <Card>
                <CardContent>
                    <Typography variant="h2" color="text.secondary" gutterBottom>
                        {title}
                    </Typography>
                    <Typography variant="h3" component="div">
                        {leader}
                    </Typography>
                    <Typography variant="h3" component="div">
                        {total}
                    </Typography>

                        {members?.length && members.map(({lastName, firstName, id}) => (
                            <div key={id} style={{ display: 'flex'}}>
                                <Avatar sx={{ bgcolor: deepOrange[500] }}>{lastName[0]}</Avatar>
                            {/*<div>{lastName}</div>*/}
                            {/*<div>{firstName}</div>*/}
                            </div>
                        ))}
                </CardContent>
                <CardActions>
                    <Button size="small">Подробнее</Button>
                </CardActions>
            </Card>
        </Container>
    );
}
